import React,{Component} from 'react';
import './App.css';
import VoteField from './VoteField';


class Voting extends Component{
	constructor(props){
		super(props);

	}

	render(){
		return(
			<div className="language">
				<h1>Vote for a language</h1>
				<VoteField languageName="Java"/>
				<VoteField languageName="JavaScript"/>
			</div>
		);
	}
}
export default Voting;
